def soundex(a,b,tresh=0.7,returnFull=False):
    a=a.upper()
    b=b.upper()
    bizar='Ã€ÃÃ‚Ã…Ã„ÃƒÃ‡ÃÃ‰ÃˆÃŠÃ‹ÃÃŒÃŽÃÃ‘Ã”Ã–Ã•Ã’Ã“Ã˜ÃšÃœÃ™Ã›ÃÅ¸'
    reglo='AAAAAACDEEEEIIIINOOOOOOUUUUYY'
    for i,c in enumerate(bizar):
        a=a.replace(c,reglo[i])
        b=b.replace(c,reglo[i])
    jw=jaro_winkler(a,b)
    ln=(1+len(a))/(1+len(b))
    if ln>1:
        ln=1/ln
    ljw=jw*ln
    #print(a,b,ljw,ln)
    if not returnFull:
        return ljw>=tresh
    else:
        return (ljw>=tresh,ljw)
        
